Zvláštne prípady: 
1. Ak má žena menštruačný cyklus dlhý približne 28 dní, môžete používať túto funkciu; 
2. Ženy, ktorých menštruačný cyklus je príliš kratší alebo dlhší, by nemali túto funkciu využívať; 
3. Obdobie neplodných dní môže ovplyvniť mnoho faktorov, funkcia tejto aplikácie je iba orientačná, neslúži ako účinná antikoncepcia.

1. Staršie (nad 65 rokov), tehotné ženy; 
2. Pacienti s diabetom alebo inými metabolickými chorobami; 
3. Kardiovaskulárne ochorenie; 
4. Pľúcne chorôb; / n5. Choroby kostí a kĺbov
